"use strict";(globalThis.webpackChunkmocpilot_docs=globalThis.webpackChunkmocpilot_docs||[]).push([[1831],{6845:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"release-2025-2-0","metadata":{"permalink":"/dk/blog/release-2025-2-0","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-11-15-post.md","title":"Official Release \u2013 MOCPilot 2025.2.0","description":"\ud83d\ude80 Introducing MOCPilot 2025.2.0 \u2014 Official Multi-Platform Release!","date":"2025-11-15T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"}],"readingTime":0.73,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"release-2025-2-0","title":"Official Release \u2013 MOCPilot 2025.2.0","authors":["maxim"],"tags":["dev"]},"unlisted":false,"nextItem":{"title":"Udgivelse af MOCPilot 2025.1.9","permalink":"/dk/blog/release-2025-1-9"}},"content":"## \ud83d\ude80 Introducing MOCPilot 2025.2.0 \u2014 Official Multi-Platform Release!\\n\\nWe\u2019re excited to announce the official release of **MOCPilot 2025.2.0**, now available across **Android**, **iOS**, and **macOS**!\\n\\nThis update marks a major step forward for the project. The application previously known as **Controlz** has been renamed to **MOCPilot**.  \\nThe new name better reflects the app\u2019s purpose and future direction \u2014 serving as a unified \u201cpilot\u201d for your LEGO\xae-based creations, providing advanced control, programming capabilities, and a more intuitive experience for builders of all levels.\\n\\n---\\n\\n\x3c!-- truncate --\x3e\\n\\n## \u2728 What\u2019s New in 2025.2.0?\\n\\n- Unified multi-platform release for Android, iOS, and macOS  \\n- Improved stability, performance, and UI responsiveness  \\n- Updated branding and identity under the new name *MOCPilot*  \\n- Continued support for LEGO\xae Control+, BuWizz 2/3, and custom Bluetooth modules  \\n\\n---\\n\\nDownload MOCPilot today on your preferred platform and take full control of your LEGO\xae creations with the next-generation building and programming experience!"},{"id":"release-2025-1-9","metadata":{"permalink":"/dk/blog/release-2025-1-9","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-06-3-post.md","title":"Udgivelse af MOCPilot 2025.1.9","description":"\ud83d\ude80 MOCPilot 2025.1.9 er nu tilg\xe6ngelig p\xe5 Mac App Store!","date":"2025-06-03T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.31,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"release-2025-1-9","title":"Udgivelse af MOCPilot 2025.1.9","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Official Release \u2013 MOCPilot 2025.2.0","permalink":"/dk/blog/release-2025-2-0"},"nextItem":{"title":"Udgivelse MOCPilot 2025.1.5","permalink":"/dk/blog/closed-test-release-2025-1-5"}},"content":"import { MacAppStoreBadge } from \'@site/src/pages/\';\\n\\n## \ud83d\ude80 MOCPilot 2025.1.9 er nu tilg\xe6ngelig p\xe5 Mac App Store!\\n\\nVi er glade for at kunne annoncere udgivelsen af MOCPilot 2025.1.9 som en native macOS-app!\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\nDu kan nu nyde fuld desktopydelse og problemfri integration med macOS.  \\nDownload den i dag fra Mac App Store, og tag kontrol over dine LEGO\xae kreationer som aldrig f\xf8r!\\n\\n<MacAppStoreBadge/>"},{"id":"closed-test-release-2025-1-5","metadata":{"permalink":"/dk/blog/closed-test-release-2025-1-5","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-05-17-post.md","title":"Udgivelse MOCPilot 2025.1.5","description":"Beskrivelse","date":"2025-05-17T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.48,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-5","title":"Udgivelse MOCPilot 2025.1.5","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Udgivelse af MOCPilot 2025.1.9","permalink":"/dk/blog/release-2025-1-9"},"nextItem":{"title":"Udgivelse MOCPilot 2025.1.4","permalink":"/dk/blog/closed-test-release-2025-1-4"}},"content":"### Beskrivelse\\n\\nDenne opdatering forbedrer blokredigeringsoplevelsen, \xf8ger ydeevnen og sikrer korrekt funktionalitet p\xe5 nyere Android-versioner.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### \xc6ndringer\\n\\n- **Rettet en fejl med hub-scanning p\xe5 Android 12+** ved at anmode om pr\xe6cis lokationstilladelse.\\n- **Tilf\xf8jet mulighed for at skjule/vis blokpaletten** ved at klikke p\xe5 den aktuelt valgte blok-samling.\\n- **Tilf\xf8jet et st\xf8rreh\xe5ndtag** til blokpaletten for at tillade **manuel \xe6ndring af st\xf8rrelse**.\\n- **Rettet h\xf8j CPU-brug** n\xe5r en profil var indl\xe6st, men programmet ikke k\xf8rte.\\n- **Forbedret \\"String list\\" blokeditoren** for at undg\xe5, at indhold blev afsk\xe5ret. Nu er elementer opdelt i kolonner for bedre overskuelighed ved store lister."},{"id":"closed-test-release-2025-1-4","metadata":{"permalink":"/dk/blog/closed-test-release-2025-1-4","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-05-10-post.md","title":"Udgivelse MOCPilot 2025.1.4","description":"Beskrivelse","date":"2025-05-10T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.75,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-4","title":"Udgivelse MOCPilot 2025.1.4","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Udgivelse MOCPilot 2025.1.5","permalink":"/dk/blog/closed-test-release-2025-1-5"},"nextItem":{"title":"Udgivelse MOCPilot 2025.1.2 - 2025.1.3","permalink":"/dk/blog/closed-test-release-2025-1-2-3"}},"content":"### Beskrivelse\\n\\nDenne opdatering forbedrer supporten til tablets, tilf\xf8jer nyttige test-sider og retter flere kompatibilitets- og ydelsesproblemer.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### \xc6ndringer\\n\\n- **Tilf\xf8jet tablet-layout** for bedre udnyttelse af st\xf8rre sk\xe6rme.\\n- **Rettet en fejl hvor blokken \\"hub button pressed\\"** dukkede op for hubs, der ikke underst\xf8tter denne handling. Rettet ogs\xe5 uhensigtsm\xe6ssige **farvesensorblokke** for ikke-underst\xf8ttede hubs (f.eks. BuWizz).\\n- **Rettet en fejl hvor \\"motor run\\"-blokken** ikke p\xe5virkede motorer uden encodere pga. manglende alternative k\xf8rsel-kommandoer.\\n- **Tilf\xf8jet en side til test af gamepad-knapper.**\\n- **Tilf\xf8jet en hub-testside** med et dashboard, der viser information, tilsluttede porte-enheder og port-rystelsesstatus.\\n- **Rettet forkert fortolkning af accelerometerdata** for BuWizz 2 og 3, som for\xe5rsagede fejlagtige orienteringsm\xe5linger.\\n- **Rettet RAM-l\xe6kager** som f\xf8rte til app-nedlukning p\xe5 nogle enheder grundet h\xf8jt systemhukommelsesforbrug.\\n- **Rettet fejl i profilindl\xe6sning** som tidligere kunne for\xe5rsage nedbrud i visse scenarier.\\n- **Rettet en Android-fejl** hvor frigivelse af gamepad-sticks ikke nulstillede aksev\xe6rdier til nul."},{"id":"closed-test-release-2025-1-2-3","metadata":{"permalink":"/dk/blog/closed-test-release-2025-1-2-3","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-04-19-post.md","title":"Udgivelse MOCPilot 2025.1.2 - 2025.1.3","description":"Beskrivelse","date":"2025-04-19T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.41,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-2-3","title":"Udgivelse MOCPilot 2025.1.2 - 2025.1.3","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Udgivelse MOCPilot 2025.1.4","permalink":"/dk/blog/closed-test-release-2025-1-4"},"nextItem":{"title":"Udgivelse MOCPilot 2025.1.1","permalink":"/dk/blog/closed-test-release-2025-1-1"}},"content":"### Beskrivelse\\n\\nDenne opdatering introducerer nye muligheder for joystick-tilpasning, forbedringer i brugergr\xe6nsefladen og vigtige stabilitetsrettelser.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### \xc6ndringer\\n\\n- **L\xf8st en fejl i blokpalettens samlingsv\xe6lger**: at v\xe6lge en samling, scrolle til en anden og vende tilbage havde ingen effekt.\\n- **L\xf8st en nedbrudsfejl ved indl\xe6sning af tunge profiler** med et stort antal blokke.\\n- **Tilf\xf8jet egenskaben \u201cAxes type\u201d** til joystick-indstillinger for at underst\xf8tte **enkelt-akse-tilstand** (X, Y, XY).\\n- **Tilf\xf8jet farvel\xe6gning** til rat-controllere (\u201cGMZ\u201d, \u201cNo Mercy\u201d).\\n- **Tilf\xf8jet \u201cer trykket\u201d blokke** til rat og pedaler."},{"id":"closed-test-release-2025-1-1","metadata":{"permalink":"/dk/blog/closed-test-release-2025-1-1","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-04-14-post.md","title":"Udgivelse MOCPilot 2025.1.1","description":"Beskrivelse","date":"2025-04-14T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.43,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-1","title":"Udgivelse MOCPilot 2025.1.1","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Udgivelse MOCPilot 2025.1.2 - 2025.1.3","permalink":"/dk/blog/closed-test-release-2025-1-2-3"},"nextItem":{"title":"MOCPilot 2025.1.0","permalink":"/dk/blog/closed-test-begin"}},"content":"### Beskrivelse\\n\\nDenne opdatering indeholder flere vigtige fejlrettelser, der forbedrer ydeevnen, reducerer batteriforbruget og forbedrer blokadf\xe6rden i programmeringsmilj\xf8et.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### \xc6ndringer\\n\\n- **L\xf8st en fejl, der for\xe5rsagede h\xf8jt CPU-forbrug, batteridr\xe6n og lav ydeevne.**\\n- **L\xf8st en fejl, hvor gamepad-blokke** (f.eks. \\"er knap trykket\\", \\"er D-PAD knap trykket\\") **ikke kunne forbindes til andre blokke.**\\n- **L\xf8st et problem i step switch event-blokken**, som h\xe5ndterede touch-begivenheder og trinopt\xe6lling forkert.\\n- **L\xf8st en fejl i listeblokkens \\"item of\\"**, hvor der ikke kunne tilknyttes mere end \xe9n blok som argumentindeks."},{"id":"closed-test-begin","metadata":{"permalink":"/dk/blog/closed-test-begin","source":"@site/i18n/dk/docusaurus-plugin-content-blog/2025-04-04-post.md","title":"MOCPilot 2025.1.0","description":"\ud83d\ude80 MOCPilot 2025.1.0 Lukket Beta er begyndt!","date":"2025-04-04T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/dk/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/dk/blog/tags/test","description":"Testing news"}],"readingTime":0.32,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Developer","url":"https://github.com/llOzzeell","page":{"permalink":"/dk/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-begin","title":"MOCPilot 2025.1.0","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Udgivelse MOCPilot 2025.1.1","permalink":"/dk/blog/closed-test-release-2025-1-1"}},"content":"## \ud83d\ude80 MOCPilot 2025.1.0 Lukket Beta er begyndt!\\n\\nVi er begejstrede for at annoncere, at den lukkede beta-test for MOCPilot 2025 nu er live! Udvalgte brugere kan nu udforske nye funktioner, give feedback og v\xe6re med til at forme MOCPilot\' fremtid.\\n\\n\x3c!-- truncate --\x3e\\n\\nHvis du har modtaget en invitation, s\xe5 tjek din email for adgangsoplysninger.  \\nTak fordi du er en del af denne vigtige fase!"}]}}')}}]);